import { Route, Navigate } from "react-router-dom";

const ProtectedRoute = ({ component, ...rest }) => {
  const authenticated = false;
  return (
    <Route {...rest}>
      {!authenticated ? <Navigate to="/login" /> : component}
    </Route>
  );
};

export default ProtectedRoute;
